import styled from 'styled-components';

export const Section = styled.div`
    height: 93vw;
    background-color: var(--white);
    color: var(--white);
    flex: 1;
    padding-top: 5px;
    padding-left: 5px;
    padding-right: 5%; 
    height: 93vw;
`;
